import React, { useState } from 'react';
import './signin.css';


export default function Signin() {


  return (
    <div className="sign-up-container">
      <h1 className="sign-up-header">Sign Up</h1>
      <form onSubmit={onSubmit} className="sign-up-form">
        <label className="form-label">
          Name:
          <input type="text" name="name" value={formState.name} onChange={(e) => setFormState({ ...formState, name: e.target.value })} className="form-input" />
        </label>
        <label className="form-label">
          Email:
          <input type="email" name="email" value={formState.email} onChange={(e) => setFormState({ ...formState, email: e.target.value })} className="form-input" />
        </label>
        <label className="form-label">
          Password:
          <input type="password" name="password" value={formState.password} onChange={(e) => setFormState({ ...formState, password: e.target.value })} className="form-input" />
        </label>
        <button type="submit" className="sign-up-button">Sign Up</button>
      </form>
      {statusMessage && <p className="status-message">{statusMessage}</p>}
    </div>
  );
}
